import React from 'react';

interface Site {
  position: { x: number; y: number };
  total_score: number;
}

interface TerrainMapProps {
  sites: Site[];
  robotPosition: { x: number; y: number };
}

const TerrainMap: React.FC<TerrainMapProps> = ({ sites, robotPosition }) => {
  // Determine the bounds of the map based on sites and robot position
  const allPoints = [
    robotPosition,
    ...sites.map(site => site.position)
  ];

  if (allPoints.length === 0) {
    return (
      <div className="h-64 flex items-center justify-center bg-gray-700 rounded">
        <p className="text-gray-400">No data available for terrain visualization</p>
      </div>
    );
  }

  // Calculate map boundaries
  const xValues = allPoints.map(p => p.x);
  const yValues = allPoints.map(p => p.y);
  const minX = Math.min(...xValues, robotPosition.x) - 5;
  const maxX = Math.max(...xValues, robotPosition.x) + 5;
  const minY = Math.min(...yValues, robotPosition.y) - 5;
  const maxY = Math.max(...yValues, robotPosition.y) + 5;

  // Calculate scale factors for converting coordinates to screen space
  const containerWidth = 100;
  const containerHeight = 100;
  const scaleX = containerWidth / (maxX - minX);
  const scaleY = containerHeight / (maxY - minY);

  // Function to convert world coordinates to percentage positions
  const toXPercent = (x: number) => ((x - minX) * scaleX);
  const toYPercent = (y: number) => ((y - minY) * scaleY);

  return (
    <div className="h-64 bg-gray-700 rounded relative overflow-hidden">
      <div className="absolute inset-0 bg-gradient-to-br from-gray-800 to-gray-900">
        {/* Grid lines */}
        <div className="absolute inset-0 opacity-20">
          {[...Array(10)].map((_, i) => (
            <div key={`v-${i}`} className="absolute top-0 bottom-0 border-r border-gray-600" style={{ left: `${i * 10}%` }}></div>
          ))}
          {[...Array(10)].map((_, i) => (
            <div key={`h-${i}`} className="absolute left-0 right-0 border-b border-gray-600" style={{ top: `${i * 10}%` }}></div>
          ))}
        </div>

        {/* Sites */}
        {sites.map((site, index) => {
          const xPercent = toXPercent(site.position.x);
          const yPercent = toYPercent(site.position.y);

          // Determine color based on score
          let color = 'bg-red-500';
          if (site.total_score >= 80) {
            color = 'bg-green-500';
          } else if (site.total_score >= 60) {
            color = 'bg-yellow-500';
          }

          return (
            <div 
              key={`site-${index}`}
              className={`absolute transform -translate-x-1/2 -translate-y-1/2 ${color} rounded-full`}
              style={{
                left: `${xPercent}%`,
                top: `${yPercent}%`,
                width: '20px',
                height: '20px',
              }}
              title={`Site ${index + 1}: ${site.total_score.toFixed(1)} score`}
            >
              <div className="absolute -top-6 left-1/2 transform -translate-x-1/2 bg-black bg-opacity-70 text-white text-xs px-2 py-1 rounded whitespace-nowrap">
                {site.total_score.toFixed(1)}
              </div>
            </div>
          );
        })}

        {/* Robot position */}
        <div 
          className="absolute transform -translate-x-1/2 -translate-y-1/2 bg-blue-500 rounded-full"
          style={{
            left: `${toXPercent(robotPosition.x)}%`,
            top: `${toYPercent(robotPosition.y)}%`,
            width: '15px',
            height: '15px',
          }}
          title={`Robot: (${robotPosition.x.toFixed(1)}, ${robotPosition.y.toFixed(1)})`}
        >
          <div className="absolute -top-6 left-1/2 transform -translate-x-1/2 bg-black bg-opacity-70 text-white text-xs px-2 py-1 rounded">
            R
          </div>
        </div>
      </div>

      {/* Legend */}
      <div className="absolute bottom-2 right-2 flex space-x-2">
        <div className="flex items-center">
          <div className="w-3 h-3 bg-green-500 rounded-full mr-1"></div>
          <span className="text-xs">≥80</span>
        </div>
        <div className="flex items-center">
          <div className="w-3 h-3 bg-yellow-500 rounded-full mr-1"></div>
          <span className="text-xs">60-79</span>
        </div>
        <div className="flex items-center">
          <div className="w-3 h-3 bg-red-500 rounded-full mr-1"></div>
          <span className="text-xs">&lt;60</span>
        </div>
        <div className="flex items-center ml-2">
          <div className="w-3 h-3 bg-blue-500 rounded-full mr-1"></div>
          <span className="text-xs">Robot</span>
        </div>
      </div>
    </div>
  );
};

export default TerrainMap;
